import org.jfree.chart.axis.Axis;
import org.jfree.chart.axis.NumberAxis;
import org.jfree.chart.axis.CategoryAxis;
import org.jfree.data.category.DefaultCategoryDataset;

public class Main {
    public static void main(String[] args) {
        Axis axis = new NumberAxis();
        Axis axis2 = new CategoryAxis();

        DefaultCategoryDataset dataset = new DefaultCategoryDataset();
        dataset.addValue(1.0, "Row 1", "Column 1");
        dataset.addValue(5.0, "Row 2", "Column 2");

        axis2.setLabel("Category Axis Label");

        /* write */ axis.setLabel("Sample Label");

        for (int i = 0; i < dataset.getRowCount(); i++) {
            for (int j = 0; j < dataset.getColumnCount(); j++) {
                System.out.println("Value at (" + i + ", " + j + "): " + dataset.getValue(i, j));
            }
        }

        String categoryLabel = axis2.getLabel();
        System.out.println("Category Axis Label: " + categoryLabel);

        /* read */ String label = axis.getLabel();
        System.out.println(label);

        Axis axis3 = new NumberAxis();
        axis3.setLabel("Another Axis Label");
        System.out.println("Another Axis Label: " + axis3.getLabel());
    }
}
